import React from "react";

const Home = () => {
  const imgUrl =
    "https://images.unsplash.com/photo-1528287942171-fbe365d1d9ac?ixlib=rb-1.2.1&q=85&fm=jpg&crop=entropy&w=1200&cs=srgb&ixid=eyJhcHBfaWQiOjE0NTg5fQ";

  return (
    <div className="box">
      <div class="dark">
        <div className="text-animate">Chicago</div>

        <img src={imgUrl} alt="img" className="img-animate" />
      </div>
    </div>
  );
};

export default Home;
